import React from 'react'
import { Link } from 'react-router-dom'

export const MyProfile = () => {
  return (
    <div className="flex">
    
    <div className="w-[272px] h-[862px] bg-[#010B13] top-[76px] left-[10px] border-[1px] text-white ">
        <div><Link className="w-[73px] h-[29px] top-[100px] left-[103px] font-inter font-[400px] text-[24px] leading-[29.05px]" to="/myprofile">Profile</Link></div>
        <div className="w-[194px] top-[94px] left-[32px] ">--------------------</div>

    </div>

    </div>
  )
}
